import React, {useState} from 'react'
import {ReactComponent as DropdownMenuIcon} from "../../Icons/filter.svg"
import Profile from "../../Icons/profile.png"


const DropdownMenu = (props) => {
  const[open, setOpen] = useState(false);
  return (
    <li>
    <a href="#" className='' onClick={()=>setOpen(!open)}>
      <DropdownMenuIcon></DropdownMenuIcon>
    </a>
    {open && props.children}
    </li>
  )
}

function DropdownMenuIU() {

  function DropDownItem(props){
    return(
      <a href='' className='menu-item'>
        <img src={props.leftIcon}></img>
        <span className='icon-button'>{/*props.leftIcon*/}</span>
        {props.children}
        <span className='icon-right'>{props.iconRight}</span>
      </a>
    )
  }

  const[logged,setLogged] = useState(false)
  if (logged==false){
    return (
      <div className='drop-down'>
        <DropDownItem leftIcon="https://cdn.iconscout.com/icon/free/png-256/account-avatar-profile-human-man-user-30448.png">My profile</DropDownItem>
      </div>
    )
  }
  else {
    return (
      <div className='drop-down'>
        <DropDownItem leftIcon={Profile}>My profile</DropDownItem>
      </div>
    )
  }
}



export default {DropdownMenu, DropdownMenuIU}
